      then amount_usd end) as USDT,sum(case when symbol = ''BUSD'' then amount_usd
      end) as BUSD,sum(case when symbol = ''USDC'' then amount_usd end) as USDC\n    from  ethereum.udm_events\n    where\n    block_timestamp
